    t[20759] = "Zur Ausgabe von Konfidenzintervallen sind stochatisch unabh\u00e4ngige Messwerte notwendig.<br>\nDie w\u00e4hrend der Simulation eines Warteschlangensystems erfassten Gr\u00f6\u00dfen sind \u00fcblicherweise jedoch nicht unabh\u00e4ngig.<br>\nDaher m\u00fcssen die Messwerte zur Ausgabe von Konfidenzintervallen in Gruppen, zwischen denen es dann (fast) keine Abh\u00e4ngigkeiten<br>\n mehr gibt, zusammengefasst werden. Dies geschieht \u00fcblicherweise \u00fcber die Batch-Means-Methode.\n</p>\n<p><br></p>\n<p>\nDurch die Aufteilung der Simulation auf mehrere Threads steht bereits eine (recht grobe) Gruppierung zur Verf\u00fcgung.<br>\nDie aktuell angezeigten Konfidenzdaten basieren auf dieser groben Aufteilung und stellen daher eine obere Absch\u00e4tzung dar.\n</p>\n<p><br></p>\n<p>\nDie Erfassung von Batch-Means-basierenden Konfidenzintervallen kann auf der Dialogseite <b>Ausgabeanalyse</b><br>\nim <b>Modelleigenschaften</b>-Dialog aktiviert werden. Daf\u00fcr muss eine Batch-Gr\u00f6\u00dfe vorgegeben werden.<br>\nDiese kann vorab \u00fcber den Men\u00fcpunkt <b>Statistik-Batch-Gr\u00f6\u00dfe bestimmen</b> im <b>Simulation</b>-Men\u00fc<br>\nautomatisch bestimmt werden.\n</p>";
